Text:
متهم بعد از #قتل #مجید_رضایی، با استفاده از روغن داغ تلاش می‌کند جسد را بسوزاند، اما وقتی موفق نمی‌شود، پیکر را مثله می‌کند، در چمدانی جا می‌دهد و با ماشین از منزل خارج می‌کند... این قساوت از کجا می‌آید؟
#اخبار_ایران #مثله_کردن
@DehkordiMaryam

خب خبر اومد که تعویض روغن ماشین برای سال اول و دوم رایگانه و فاکتوری که برام فرستادن فقط محض اطلاع بوده، بریم مواد غذایی بخریم 
ایندفعه نریدم مندس 
