کسی که روغن ماشین رو تعویض میکنه چرا اجرت میگیره؟ و چرا توی کرج اجرت تعویض مثلا ۵۰ تومنه تو تهران ۱۰۰. یا اصلا توی مناطق شمال شهر تهران ۲۰۰ تا ۳۰۰؟

نکته اینجاست این افراد و هزاران مثال دیگه در درجه اول پول وقت و انرژیشون رو میگیرن و بعد حالا موارد دیگه.
@afzouni

آهای ایهالناس روغن ماشین آلات صنعتی تو بازار نیست. امروز با التماس ۲۰ لیتر روغن بهران ۵۰ و ۲۰ لیتر روغن توربو دیزل گرفتم. آخه این چه مدل مملکتداری هست؟
@Rouhani_ir

@MB_Nobakht

توی بررسی یک ماشین (دنا پلاس)، حداقل عکس هایی که میگیرید یکم حرفه ای تر باشه. کف پایی ماشین کثیف، روغن ریخته شده دور موتور، آفتابگیر از پشت صندلی زده بیرون و ...
نکته مثبت هم پوشش پلاک ماشین بود. 
